function set_element_basic_style(pre_sentence_element) {
	pre_sentence_element.style.position = "absolute";
	pre_sentence_element.style.offsetHeight = text_box_height;
	pre_sentence_element.innerHTML = pre_sentence;
	pre_sentence_element.style.width = part3_text_box_width;
	pre_sentence_element.style.fontSize = "smaller";
	pre_sentence_element.style.overflow = "hidden";
	pre_sentence_element.style.textOverflow = "ellipsis";
	pre_sentence_element.style.whiteSpace = "nowrap";
	pre_sentence_element.className = "all_sentences";
	pre_sentence_element.style.color = part3_text_box_color;
	pre_sentence_element.style.zIndex = 0;
	pre_sentence_element.style.fontFamily = "字魂47号";
}

function set_element_location_style(pre_sentence_element) {
	a = Math.cos(present_angle * Math.PI / 180);
	var pre_sentence_x = x_center + radius * Math.cos(present_angle * Math.PI / 180);
	var pre_sentence_y = y_center + radius * Math.sin(present_angle * Math.PI / 180);
	present_angle = present_angle + angle;
	if (pre_sentence_x < x_center) {
		pre_sentence_element.style.left = (pre_sentence_x - pre_sentence_element.offsetWidth).toString() + "px";
		pre_sentence_element.style.top = pre_sentence_y.toString() + "px";
	} else {
		pre_sentence_element.style.left = pre_sentence_x.toString() + "px";
		pre_sentence_element.style.top = pre_sentence_y.toString() + "px";
	}
}

